import React from "react";
import ReactDOM from "react-dom";
//import "./index.css";
import fam from "./Mep";

function Card(Props){
  return (
    <>
    <span>
    <h1> {Props.name} is my:</h1> <h1>{Props.value}</h1>
   
      </span>
    </>
  )
}


ReactDOM.render(
   <>
   <Card name="Mubarak ansari" value="father"/>
    </>
 ,document.getElementById("root"));
